(401, 'Teledevelopment Services, Inc', 'TeleDevelopment has been providing clients with global outsourcing and back-office solutions since 1991. Since that time, we have supported over 450 captive and outsourced teleservices and BPO providers’ human capital and process development needs. Our expertise is the result of engagements with in-house as well as service providers and shared service centers throughout the world. Working from our offices in the United States, the Philippines, and the Dominican Republic; we deploy experienced professionals to help organizations succeed from any location — domestic, near-shore, and offshore.', '0123456789', '9876543210', 0, 0, 0, 'PH', '', '', 'http://www.teledevelopment.com', '1-20101022-TDS_logo_resized.jpg', '2010-09-01 00:00:00', '2010-12-10 00:00:00', 1, 0),
(402, 'Hinduja Global Solutions Ltd.', 'HINDUJA Global Solutions  was envisioned in mid-2004 when HINDUJA completed the acquisition of Customer Contact Center (C-Cubed), the recognized pioneer in the Philippine contact center industry.  Over the past two years, HINDUJA has not only integrated the business under a common umbrella but also accelerated the growth in business to a staggering 140% in terms of employment.   \r\n\r\nFull-scale operations started in March 2006 at HINDUJA Cyberpark, a 2,000-seat state-of-the-art call center facility located in Quezon City.  Occupying an area of more than 10,000 square meters, the Cyberpark is HINDUJA’s single largest facility outside India. \r\n\r\n\r\nHINDUJA Global Solutions (HGS)\r\nHINDUJA Global Solutions  is a publicly traded company listed on the Bombay Stock Exchange and National Stock Exchange of India.  Counted among India’s Top 150 Companies, HINDUJA has a market capitalization of about US$ 350 million.  The company registers a consistent 40 to 50 percent annual growth rate, with revenues totaling US$ 60 million. \r\n\r\nIts core business being IT and IT-Enabled Services, HINDUJA Global Solutions  primarily provides time-efficient and cost-effective business solutions in business process outsourcing, both voice and data.  The company serves some of the biggest corporations in a diverse range of industries across the globe from eight cities namely, Bangalore, Mumbai, Chennai, Hyderabad, Manila, Mauritius, New Jersey and Toronto.\r\n\r\nAs a dominant player in the global outsourcing industry, HINDUJA Global Solutions  is fully equipped with the essential elements that have ensured its continued success:\r\n\r\n&#61607;	Engagement methodologies for onsite, near-shore and off-shore operations.\r\n&#61607;	Efficient knowledge transfer systems across locations and across business sectors.\r\n&#61607;	Competent and highly driven employees.\r\n&#61607;	Quality and security, as assured by its ISO9001-2000 and BS7799/ISO270001 joint certifications.\r\n&#61607;	Superior infrastructure.\r\n&#61607;	Proven project management skills. \r\n\r\nHINDUJA Global Solutions'' parent company is the Hinduja Group, a transnational investment banking and trading conglomerate with presence in over 50 countries in five continents.  Established in 1914, the Hinduja Group now has a workforce of more than 32,000 deployed worldwide, and a multi-billion dollar annual turnover. \r\n\r\nWhy Outsource?\r\nToday, the need to reduce operational and capital expenses coupled with emerging technologies, severe resource shortages and complex regulatory requirements are challenging organizations everywhere to find new ways to operate more efficiently without sacrificing quality.  By outsourcing, you will be able to focus on getting your product to market faster and expanding your marketplace with substantially lower operations costs. \r\nHINDUJA is the Answer\r\n\r\nAccount Management\r\nHINDUJA’s dedicated account team works closely with you to identify and integrate the most effective and cost-efficient services based on your current environment and future performance needs.  An account manager supports you through the length of the contract.\r\n\r\nAchieve or Maintain Focus on Your Primary Business\r\nWith HINDUJA providing turnkey solutions, you can improve focus on your corporate strategies while having the satisfaction of knowing that your outsourced process is in safe professional hands.  This ability to focus better enables you to enhance your products, services and sales. \r\n\r\nBecome More Competitive in the Marketplace\r\nOutsourcing with HINDUJA enables you to enhance your competitive edge in the market.  You would be able to introduce new products into the market with minimal costs related to training, personnel and technology implementation. \r\n\r\nObtain World-Class Information Technology Capabilities and Resources\r\nHINDUJA Information Systems infrastructure combines the latest technology and technical expertise to give your company the ability to reduce costs associated with processing, system development, staffing and training.  \r\n\r\nBecome More Cost-Effective and Flexible\r\nCost reduction is directly associated with improved applications development, systems management, and transaction processing.  By outsourcing with HINDUJA, you can put increased resources towards meeting the company goals, optimizing financial assets and reducing administrative costs. \r\n\r\nImproved Internal Service\r\nHINDUJA helps improve quality and customer satisfaction by providing a superior level of service to both internal and external constituents.', '0123456789', '9876543210', 0, 0, 0, 'PH', '434-5130', '', 'www.teamhgs.com/', '2-20110927-HGS Logo.JPG', '2010-09-01 00:00:00', '2011-12-05 00:00:00', 1, 0),
(403, 'Teleperformance', '', '0123456789', '9876543210', 0, 0, 0, 'PH', '', '', 'http://www.teleperformance.com', '3-20101104-teleper_580x120.gif', '2010-09-01 00:00:00', '2010-11-09 00:00:00', 1, 0),
(404, 'IBM Global Process Services - Contact Center and CRM Solutions', '', '1234567890', '0987654321', 0, 0, 0, 'PH', '', '', 'www.facebook.com/myIBM', '4-20101203-ibm_580x120.gif', '2010-09-15 00:00:00', '2010-12-03 00:00:00', 1, 0),
(405, 'Sykes Philippines', 'Welcome to the new SYKES\r\n…Over 30 years of combined experience in customer care.\r\n… 13 sites located in the Philippines and more than 80 centers in 24 countries. \r\n… More than 17,000 dedicated employees in the Philippines and 51,000+ employees across the globe.\r\n\r\nSYKES Asia, the Asia Pacific arm of Sykes Enterprises Incorporated, is the officially recognized pioneer in the Philippines call center industry. Operations began in 1997 by offering only technical support to a single client with a workforce of 17 employees. \r\n\r\nToday, SYKES has grown into a distinguished leader in the industry. The company provides contact center, customer service, technical support and back office processing services to Fortune 1000 clients around the globe from 13 sites in the Philippines, including provincial sites located in Cebu and Cabanatuan, and backed by more than 17,000 highly-capable and dedicated employees.', '005057181000', 'A1997-09122', 0, 0, 0, 'PH', '', '', 'http://www.sykes.com/careers/philippines.aspx', '5-20101104-sykes_580x120.gif', '2010-09-20 00:00:00', '2011-03-04 00:00:00', 1, 0),
