(415, 'BPOCareerHub', 'BPOCareerHub.com is a new online job portal that focuses mainly on providing career opportunities in the two largest and most in-demand industries: Business Process Outsourcing (BPO) and Knowledge Process Outsourcing (KPO).\r\n\r\nBPOCareerHub.com’s founder saw the fast growth of the outsourcing industries in the country as well as its increasing demand for quality. The website was launched in September 25, 2010 and already had thousands of visitors and registrants since.\r\n\r\nBPOCareerHub.com was made by the industry for the industry.\r\n\r\n\r\nFor Employers:\r\n\r\nWe provide employers with a complete set of online services that include job postings, banner advertisements, and articles on news, events and career counseling. Our online-based set of software applications make the recruitment process time-saving, seamless and cost-efficient.\r\n\r\n\r\nFor Job Seekers:\r\n\r\nAlthough we primarily cater to two industries (BPO and KPO). the career opportunities are diverse and is not limited to call center agent positions. Job openings for nurses, legal, accountants, marketing professionals, procurement officers, quality assurance specialists and graphic designers are needed to build stable and long lasting BPO and KPO companies.\r\n\r\n\r\nWhy BPOCareerHub.com?\r\n\r\nBPOCareerHub.com’s database only comprises of individuals who are interested and more than willing to work in BPO and KPO companies. \r\n\r\nWith BPOCareerHub.com, you can be sure that your BPO and KPO companies are tapping the right medium to get qualified candidates.', '0123456789', '9876543210', 0, 0, 0, 'PH', '5709739', '', 'http://www.bpocareerhub.com', '15-20110711-15-20101104-bch_580x120.gif', '2010-10-11 00:00:00', '2012-01-16 00:00:00', 1, 0),
