(420, 'WNS Global Services Philippines Inc.', 'WNS is a leading global business process outsourcing company. Deep industry and business process knowledge, a partnership approach, comprehensive service offerings and a proven track record enables us to deliver business value to the world''s leading companies. WNS is passionate about building a market leading company valued by our clients, employees, business partners, investors and communities. As a leading global business process outsourcing company, WNS "extends the enterprise" of some of the world’s best brands. Through our global delivery network and a comprehensive service offering, we deliver business value to our clients by combining operational excellence and deep domain - industry and functional - knowledge.', '0000000000', 'CS200909639', 0, 0, 0, 'PH', '', '', 'www.wns.com', '20-20101207-wnslogo2.JPG', '2010-11-03 00:00:00', '2010-12-07 00:00:00', 1, 0),
(421, 'Convergys Philippines', 'Convergys Corporation Philippinesis the premiere career destination in the country, as we provide the opportunities to make your dreams real ---- We have 24, 000 stories to tell which prove that we can.\r\n \r\nBecause we are the BIGGEST and the BEST, we offer true career development, healthcare benefits, above industry compensation, a warm and enjoyable work environment, and a culture of diversity, that guarantee professional and personal growth. We discover within people their inherent strengths and develop paths that lead to their success.\r\n \r\nWe know how to take care of our employees because we focus on the things that make the real difference for success. We deliver unparalleled customer satisfaction because our workforce is empowered - this approach has made us a global leader for 25 years. Headquartered in Cincinnati, Ohio, Convergys employs nearly 75,000 employees who serve clients in over 70 countries, speaking more than 35 languages, from 79 sites across the globe. We have been named a Fortune Most Admired company for seven consecutive years, and more than half of the top 50 Fortune 500 companies are Convergys clients. We definitely know how to make your careers grow, look at us.\r\n \r\nHere in the Philippines, from a single contact center in Manila, which opened in 2003, Convergys now has 14 contact center facilities in the Philippines – 10 located throughout Metro Manila, 3 in Cebu City, and our 14th center, in Bacolod City. We employ approximately 24,000 Filipinos since we started operations and we are constantly in search of the best and the brightest people to join our growing family as we continue to expand our business.\r\n \r\nIn Convergys, we do great things everyday. We offer opportunities that will lead to your success, a great place to work, and a family that you can be part of. If you are driven to jumpstart a winning career, and yearn to be part of something special, this is your chance. Come and make your dreams real with Convergys.\r\n \r\n \r\n\r\n--------------------------------------------------------------------------------\r\n\r\n \r\nBE A FACEBOOK FAN >>> Convergys Philippines\r\n \r\nFOLLOW US IN TWITTER >>>  Convergysphils', '220866782000', 'CS200257684', 0, 0, 0, 'PH', '', '', 'www.convergysphilippines.multiply.com', '21-20101208-CVG_logo2-colora.JPG', '2010-11-10 00:00:00', '2010-12-08 00:00:00', 1, 0),
(422, 'Apac Customer Services Inc.', NULL, '00000000', 'A200210137', 0, 0, 0, 'PH', '', '', 'http://www.apaccustomerservices.com/', NULL, '2010-11-11 00:00:00', NULL, 1, 0),
(423, 'MicroSourcing Philippines, Inc.', 'MicroSourcing Philippines Inc, is one of the leading outsourcing solutions providers in the Philippines. We specialize in setting up offshore operations for foreign clients who operate in a wide variety of industries all over the world. Our offices are located in the Eastwood City Cyberpark and form the perfect professional environment from which we can run our various projects. MicroSourcing is a fast moving and flexible company with a great international management team.', '007-000-086', 'CS200804419', 0, 0, 0, 'PH', '', '', 'http://www.microsourcing.com', '23-20101117-image001.jpg', '2010-11-12 00:00:00', '2012-01-06 00:00:00', 1, 0),
(424, 'lasting line contact center', '', '006-931-466-000', 'cs200718937', 0, 0, 0, 'PH', '', '', 'www.lastingline.com', '24-20101216-lastingline_580x120.gif', '2010-11-19 00:00:00', '2011-02-16 00:00:00', 1, 0),
(425, 'SPi GLOBAL (SPi CRM)', 'Global Solutions. Multinational Platform. \r\n\r\nSPi Global Solutions is one of the world''s largest and most diversified Knowledge Process Outsourcing and Customer Interaction service providers in the industry in terms of clients, geographic presence, and capabilities with more than 14,000 dedicated employees globally.\r\n\r\nFor more than 28 years, we have been offering Fortune 500 companies a full roster of high quality, innovative, end-to-end solutions. Our clients look to us for:\r\n\r\n•       a wide range of voice and non-voice BPO solutions\r\n•	the broadest global delivery network with 29 locations spanning North America, Europe, and Asia\r\n•	the ability to effectively combine deep domain knowledge with our core capabilities to deliver high quality, single source solutions that provide cost-efficiencies, scalability and exceptional customer care.\r\n\r\nOne Vision. Multiple Competencies.\r\n\r\nSPi provides domain expertise in the Customer Interaction, Healthcare, Legal, and Publishing markets. We also provide services across a wide-range of industries including banking and financial services, government, information technology, media, not-for-profit organizations, retail, and travel.\r\n\r\nEstablished. Evolving. Excellence.\r\n\r\nWelcome to SPi Global Solutions.  The future of BPO.', '234-045-461', '1234567890', 0, 0, 0, 'PH', '', '', 'www.spi-global.com', '25-20101203-spi_580x120.gif', '2010-12-02 00:00:00', '2010-12-03 00:00:00', 1, 0),
(426, 'BCC', NULL, '000000000', '000000000', 0, 0, 0, 'PH', '', '', '', NULL, '2010-12-07 00:00:00', NULL, 1, 0),
(427, 'DSM Manila LLC', 'DSM “Manila” LLC Established in August of 2007 and with corporate headquarters situated within the Makati Central Business District, DSM “Manila” LLC provides Shared Services support for the international office network of White & Case LLP, a leading US-based global law firm. DSM Manila fuses customer-attentiveness with creativity and innovation, and always seeks to exceed client expectations by offering outstanding customer service, increased flexibility and timely solutions to all issues and concerns. Having grown from a humble team of 5, to its present staff compliment of 140, DSM Manila continues in its commitment to provide the best solutions support for White & Case LLP offices worldwide.\r\n\r\n\r\n\r\nWhite & Case LLP is a leading global law firm with more than 2,400 lawyers in 34 offices in 23 countries. Among the first US-based law firms to establish a truly global presence, we provide counsel and representation in virtually every area of law that affects cross-border business. Our clients value both the breadth of our global network and depth of our US, English and local law capabilities in each of our regions and rely on us for their complex, cross-border transactions, arbitration and litigation provided by our global practices. Whether in established or emerging markets, the hallmark of White & Case is our complete dedication to meeting the business priorities and legal needs of our clients. Our approach is based on listening to our clients’ needs, taking the time to understand their business and responding with effective strategies and solutions, no matter how big the opportunity or formidable the challenge. With new technologies, globalization, consolidation and other forces continuously changing how business gets done, we help our clients evaluate risks and rewards of ventures designed to advance their interests. We work with the world’s most established and respected companies, including two-thirds of the Global Fortune 100 and half of the Fortune 500, as well as start-up visionaries, governments and state-owned entities.', '254-272-458-000', 'FS200711530', 0, 0, 0, 'PH', '', '', '', '27-20110112-DSM-Manila2.JPG', '2010-12-14 00:00:00', '2011-01-13 00:00:00', 1, 0),
(428, 'West Contact Services', NULL, '227-466-678', 'CS200323443', 0, 0, 0, 'PH', '', '', '', NULL, '2011-01-05 00:00:00', NULL, 1, 0),
(429, 'CLART Marketing Corporation', 'WHO WE ARE\r\n\r\nWe are a full service contact center enabling U.S., U.K, Canadian, and Australian companies to dramatically increase revenues and at the same time decrease customer acquisition and retention costs through our highly efficient and highly effective telemarketing and customer service offerings. \r\n\r\nWe specialize in B2B and B2C telemarketing activities.\r\n\r\nOur contact center is strategically located at the heart of Mandaluyong City, Metro Manila, Philippines near fiber-optic facilities of the country''s major telecommunications providers and where there is an abundance of an English speaking workforce.\r\n\r\nBehind our service offerings are highly energetic and results-driven telemarketing professionals that are amongst the best in the industry.We manage our clients'' marketing activities through our robust informations systems that enables us and our clients to make relevant marketing decisions based on timely and accurate data.', '000052576', '116354', 0, 0, 0, 'PH', '5322624', '4340467', 'www.clartmarketing.com', '29-20110330-clart banner.jpg', '2011-01-14 00:00:00', '2011-03-30 00:00:00', 1, 0),
