(433, 'Yell Adworks Philippines', 'Yell Adworks is part of the Yell Group the international directories business, and began its activity in 1979. We are a leading provider of multimedia advertising services in the United Kingdom, United States, Spain and Latin America.\r\n\r\nOur core business is to support Yell and its aim to help businesses succeed by connecting them with customers better than anybody else.\r\nWe do this by designing and fulfilling digital content for multimedia advertising, in print and online, and by delivering associated services. These services are provided from operations in the UK, USA, Spain, India, Philippines, Peru and Colombia.\r\n\r\nOur business is able to do this because we believe in:\r\n•	Achieving the highest quality at the best price\r\n•	Working without boundaries\r\n•	Delivering locally by working globally\r\n•	Business creativity\r\n•	Focusing on tomorrow, today\r\n\r\nOur global platform ensures that at any given time, over 3,000 Yell Adworks people are working to help Yell in the UK, Yellowbook in the US and Yell Publicidad in Spain and Latin America meet the requirements of its customers.\r\n\r\nOur remit is a wide and varied one, but perhaps the easiest way to explain what we do is to tell you what we''ve delivered in the past year:\r\n•	More than 1 million integrated media products including website products, video and social media\r\n•	More than 4 million customer service calls\r\n•	More than 3 million adverts and spec visuals for printed directories\r\n•	More than 500,000 classified pages\r\n\r\nYell Adworks Philippines employs over 500 people supporting our operations in the US and UK from our location in Manila.\r\n\r\nOur people the Philippines help deliver over 100,000 websites and videos and over 2 million print ads.\r\nYell Adworks Philippines employs Graphic Artists, Proofreaders, Web Support Specialists, and Directory Review Services Associates all led by our General Manager, Mr. Sherwin Que.\r\n\r\nFor more information visit: www.yelladworks.com', '007-824-850-000', 'CS201011514', 0, 0, 0, 'PH', '', '', 'http://www.yelladworks.com/philippines-recruitment', '33-20110307-123.JPG', '2011-02-02 00:00:00', '2011-03-11 00:00:00', 1, 0),
