(620, 'My Outdesk Inc.', 'MyOutDesk Inc. is a Southern California based business process services company with delivery offices located in the United States and the Philippines. By having MyOutDesk Inc. virtual assistants (VAs) work from their fully-equipped home offices in Southeast Asia we are able to offer significant cost savings to our clients compared to similar USA based service providers who may charge anywhere from $15 to $50 per hour. MyOutDesk Inc. is able to offer better service and results for an average range of $6.25 to $7.50 per hour.', '00000000', '00000000', 0, 0, 0, 'US', '1800583995', '', 'http://myoutdesk.com', NULL, '2011-05-17 00:00:00', '2011-05-23 00:00:00', 1, 0),
(621, 'Devinecare, Inc', 'DevineCare, Inc (DCI) is a multi-national company (American to be exact) whose mother company is located in the united States carrying the name Devine Communications, Inc.(DCI) DCI is a PEZA registered company engaged in the business of providing services including but not limited to outsourced billing and billing information services, outsourced contract managemnet services for customers, employees and business-channel partners and cient organiztions through the medium of telephone, email and web-based interactions. DCI has its own product which is a pre-paid long distance call from the United States or Canada to the Philippines. The product is used mainly by Filipinos in the two countries mentioned. In the Philippines, we just opened our customer service section to provide unbelievable customer satisfiaction to our faithful customers as well as new customers. This is located at unit 2501 of Unionbank Plaza, Ortigas Center, Pasig City.', 'bogus', 'bogus', 0, 0, 0, 'PH', '0000000', '', 'http://www.devinecareinc.com/', '221-20110527-devincare.jpg', '2011-05-23 00:00:00', '2011-05-27 00:00:00', 1, 0),
(622, 'RR Donnelley Global', 'With more than a 140-year heritage of integrity, RR Donnelley is the world’s premier provider of print, document management, supply chain solutions and business services.\r\n\r\nRR Donnelley Global BPO, formerly known as OfficeTiger, is among the leading outsourcing companies offering judgment based, industry focused services on a global scale. Our 7700 strong work force operates out of 28 delivery and 41 on-site operation centers, spread across 9 countries. Founded in 1999, we service some of the largest Fortune 500 companies in the world.\r\n\r\nWe invite you to be part of our growing community.', 'bogus', 'bogus', 0, 0, 0, 'PH', '0000000000', '', '', '222-20110527-RRDLogo.gif', '2011-05-23 00:00:00', '2011-05-27 00:00:00', 1, 0),
(623, 'Savvysherpa Asia, Inc. (Cebu)', NULL, 'bogus', 'bogus', 0, 0, 0, 'PH', '0000000000', '', '', NULL, '2011-05-23 00:00:00', NULL, 1, 0),
(624, 'Sitel Philippines Corporation', 'Sitel is redefining outsourcing excellence in the contact center, by raising the bar on expectations.\r\n\r\nWe are the leading global business process outsourcing provider of customer care and complementary back-office processes.\r\n\r\nAccording to the Black Book of Outsourcing, Sitel is the number one global call center outsourcing provider and received the top score in 11 critical performance categories including vertical expertise, reliability, innovation, trust, flexibility and customization. \r\n\r\nThis proves, when you focus on your core competency, that you can be better than anyone else in the world.\r\n\r\nSitel''s clients, many of the largest and well known brands in the world, have selected and continue to partner with Sitel for one reason; Sitel delivers the results they want; Sitel delivers Return on Customer Investment (RoCI)', 'bogus', 'bogus', 0, 0, 0, 'PH', '8601111', '6345414', '', '224-20110527-sitel logo.jpg', '2011-05-23 00:00:00', '2011-05-27 00:00:00', 1, 0),
(625, 'HRMall', NULL, 'bogus', 'bogus', 0, 0, 0, 'PH', 'N/A', '', '', NULL, '2011-05-23 00:00:00', NULL, 1, 0),
(626, 'Accenture', '', 'bogus', 'bogus', 0, 0, 0, 'PH', '8425012', '', 'www.accenture.com', '226-20110527-phplo158VPM.jpg', '2011-05-23 00:00:00', '2011-05-27 00:00:00', 1, 0),
(627, 'SPi Technologies Inc.', '<b>Global Solutions. Multinational Platform.</b>\r\n\r\nSPi Global is one of the world''s largest and most diversified Knowledge Process Outsourcing (KPO) and Customer Relationship Management (CRM) service providers in the industry in terms of clients, geographic presence, and capabilities. We have over 15,000 dedicated BPO professionals globally.\r\n\r\nWe are also proud to let you know that SPi Global is the "BPO Company of the Year" for 2011, a recognition given by the International ICT Awards. For more than 30 years, we have been offering Fortune 500 companies a full roster of high quality, innovative, end-to-end solutions. Our clients look to us for:\r\n\r\n    * a wide range of voice and non-voice BPO solutions\r\n    * the broadest global delivery network with 24 locations spanning North America, Europe, Australia and Asia\r\n    * the ability to effectively combine deep domain knowledge with our core capabilities to deliver high quality, single source solutions that provide cost-efficiencies, scalability and exceptional customer care.', 'bogus', 'bogus', 0, 0, 0, 'PH', '8877488', '8517119', 'http://www.spi-global.com/', '227-20110602-spi.JPG', '2011-05-23 00:00:00', '2011-06-02 00:00:00', 1, 0),
