(631, 'Startek International Limited', 'StarTek currently occupies two state-of-the-art facilities in the Philippines’ premiere business districts -- Makati City and Ortigas Center. The Makati office is at the SM CyberOne building along Jupiter Street and the Ortigas office is at the ETON Cyberpod Corinthian office fronting Robinson’s Galleria.  Both sites have a total combined capacity of 3,600 employees. Standard in all beautifully designed StarTek locations are large work stations and conveniences such as 24/7 food service, themed pantry areas, game rooms, internet surfing stations and nap rooms. We also have employee interest clubs called Employee GIGS (Genuinely Interesting Guilds) that any employee can join which feature arts, lifestyle, photography, sports, mountaineering and communityevents.\r\n \r\nStarTek is committed to giving back to the community. We have given support to the following organizations: Philippines National Red Cross, Gawad Kalinga (Housing Project for the poor), La Mesa Dam Ecological Reserve, Cancer Warriors (Kids with Cancer), UNICEF and World Vision to name a few.\r\n \r\nWe look forward to seeing you at StarTek.  Where your career really moves!', 'bogus', 'bogus', 0, 0, 0, 'PH', '8117827', '', 'www.startek.com', '231-20110601-startek.JPG', '2011-05-23 00:00:00', '2011-06-01 00:00:00', 1, 0),
