(633, 'Affiliated Computer Services, Inc. (ACS Phils)', 'ACS, A Xerox Company, is a global leader in business process and information technology services. That covers a lot of ground, from finance and accounting and transaction processing to IT outsourcing, human resource services and customer care.\r\n\r\nEverything we do is driven by a single overriding mission: to help our clients focus on their core business. We serve such wide-ranging industries as Government, Communications, Manufacturing, Retail, Financial Services, Healthcare, Education, and Transportation.\r\n\r\nWe deliver operational excellence. From Business Process Re-engineering, to managing our clients’ operations, it drives everything that we do. Every year we receive industry recognition from the leading research and advisory firms in the service industry.', 'bogus', 'bogus', 0, 0, 0, 'PH', '87774736', '', 'http://www.acs-inc.com', '233-20110526-ACS2.JPG', '2011-05-23 00:00:00', '2011-05-26 00:00:00', 1, 0),
