(639, 'Sutherland Global Services Inc.', 'Sutherland Global Services is a multinational Technology-Enabled and Business Process Outsourcing (BPO) company specializing in Integrated BPO solutions across the back and front office that support the entire lifecycle of our client’s customers.\r\n\r\nHaving started operations in 1986 in Rochester, New York, Sutherland now employs over 29,000 professionals offering RightSourcing™, seamlessly blended services from its 32 delivery centers in Bulgaria, Canada, Colombia, Egypt, India, Mexico, Philippines, the United Arab Emirates, the United Kingdom, and the United States. By integrating highly trained people with state-of-the-art technology and proven business methodologies, Sutherland collaborates with clients to help them excel in their industry and maximize their customers’ lifetime value.', 'bogus', 'bogus', 0, 0, 0, 'PH', '4592900', '8897191', 'www.sutherlandglobal.com', '239-20110601-suther.JPG', '2011-05-23 00:00:00', '2011-06-01 00:00:00', 1, 0),
(640, 'AllsecTech Manila, Inc.', 'Allsec Technologies Limited (NSE – ALLSEC) India is a pure play, third-party Business Process Outsourcing (BPO) Company offering both voice and non-voice services on a blended delivery platform. Starting out in 1998, Allsec has emerged as a global corporation, servicing veritable corporate majors across the world on a 24/7/365 basis. Balancing rapid growth with an expansion in service offering, Allsec is acknowledged for its expertise in Banking, Financial Services and Insurance, Technical Support, Quality Assurance and Human Resource Processing domains.\r\n\r\nAllsec Technologies began to expand in the Philippines to complement the demands of US clients, who prefer to be outsourced here than in India due of the country’s affinity to American culture, as well as to tap other potential Southeast Asian markets. The 150-seater BPO Kingdom Builders, Inc. (KBI) in Ortigas was bought by Allsec Technologies in October 2007. The agreement involved acquisition of 100 percent of KBI''s shareholdings by Allsec Technologies. As a result, a handful of changes have taken place with the company, primarily its name, which is now AllsecTech Manila Inc. and its location, which is now at the Third Floor of Market! Market! Bonifacio Global City, Taguig, Metro Manila. The new facility has been inaugurated on the 25th of January 2008.\r\n\r\nAllsecTech Manila, Inc. now caters to the needs of existing and proposed customers from the US, Australian and ASEAN markets. Allsec Technologies has also scaled the capacity of AllsecTech Manila to 750 seats.', 'bogus', 'bogus', 0, 0, 0, 'PH', '0000000', '', '', '240-20110527-phpoDgShzPM.jpg', '2011-05-23 00:00:00', '2011-05-27 00:00:00', 1, 0),
