(643, 'ANZ', 'As one of the largest company in Australia, our values help build a sustainable future for our business, shareholders, staff, customers and communities. Our business serves more than six million customers and our assets are worth $293 billion. We employ more than 30,000 people and are represented in our primary markets of Australia and New Zealand, as well as Asia, the Pacific, the UK, Europe and the United States.\r\n\r\nANZ Philippines has principles, policies and practices that create a positive environment for our people. We value and reward open communication and workplace relationships that are based on integrity and trust.\r\n\r\nWe promote diversity and value people’s different backgrounds. We encourage employees to be their true selves at work. We share workloads, difficulties as well as joys and laughs inside and outside the bank. We are empowered to make decision within our own responsible area.\r\n\r\nAt ANZ Philippines, we embrace our ANZ global Breakout - cultural transformation program - which builds a vibrant, energetic and high-performing culture where ANZ values are the basis for the actions we take and decisions we make each day.', 'bogus', 'bogus', 0, 0, 0, 'PH', '8417777', '', 'www.anz.com', '243-20110602-ANZ.JPG', '2011-05-23 00:00:00', '2011-06-02 00:00:00', 1, 0),
