(655, 'kgb', 'Founded in 1992, kgb is a privately held, New York-based company and the world''s largest independent provider of directory assistance and enhanced information services. During its seventeen-year history, kgb has built some of the most successful and recognizable retail brands in the tele-communications and enhanced information services sector in Europe, including The Number 118 118 in the United Kingdom and Le Numero 118 218 in France, both of which have the largest market share in their respective markets. kgb is also the largest and fastest-growing independent wholesale directory assistance service provider in the U.S. In 2009, kgb launched 542 542, the premier text answer service in the U.S.\r\n\r\n\r\nkgb has pioneered the provision of a broad range of wholesale and retail information services beyond traditional directory assistance services, including call completion, movie listings, train schedules, price comparisons, and "Ask Us Anything" service across multiple platforms, including mobile and landline phones, SMS and the Internet. In 2008, kgb won the Pelorus Award for the Best Text Directory Information Service in the Unites States. Last year kgb served more than a hundred million consumers globally and answered nearly a billion questions.', 'bogus', 'bogus', 0, 0, 0, 'PH', '6327551600', '', 'http://www.kgbph.com/', '255-20110601-kgb.JPG', '2011-05-23 00:00:00', '2011-06-01 00:00:00', 1, 0),
