(658, 'TOTAL TRANSCRIPTION SOLUTIONS, INC (TTSI)', 'Total Transcription Solutions, Inc. (TTSI) specializes in providing medical transcription and other healthcare information documentation services to various medical facilities and insurance companies in the United States.', 'bogus', 'bogus', 0, 0, 0, 'PH', '0000000000', '', 'http://www.totaltranscription.com/', '258-20110601-Ttsi.JPG', '2011-05-23 00:00:00', '2011-06-01 00:00:00', 1, 0),
(659, 'Transcom Worldwide (Philippines), Inc.', 'Overview\r\nTranscom Worldwide (Philippines), Inc., Europe’s largest call center is currently searching the market for a wide variety of skilled individuals to man our various accounts.  We have been in the industry for  16 years, with 75 sites across 27 countries in the world.  In our workforce are 24,000 employees handling 600,000 customer contacts in 33 languages for more than 350 clients in the world.  Our clients are leaders in today’s most competitive industries, including all five of the world’s biggest banks (ranked by asset value), and three of the world’s five largest mobile phone networks. Our experience is used to constantly refine our service portfolio and processes and delivery, allowing us to respond quickly to changing market conditions and client requirements.\r\n\r\nWhy Join Us?\r\nTranscom is a global employer in an industry that depends upon strong, resourceful, talented people.  \r\nIn return for commitment, hard work and talent we offer competitive salaries and benefits, high quality training and opportunities to forge a career in a progressive, client focused business. \r\nWe value independent thinking and individual effort, but even more, we value team work. Transcom people put our clients and our business first, take responsibility for their actions and are as concerned for their colleagues’ success as for their own. \r\n \r\nTranscom is a results focused company. Your progress will be determined by your talent and your contribution to the success of your team and our business.\r\n\r\nOur goal is that every employee becomes their own best motivator, and that management’s role in this area is to foster a culture of motivation that is effective in the long term. Finding the right triggers to motivate the staff is crucial, especially in a company with such an enormous diversity of cultures. We believe in being sensitive to employees’ perspective of what motivation is, and being close enough to our employees to be aware of the mood in the various departments.\r\n\r\nTranscom is constantly growing, creating more positions and career possibilities. Through our coaching, appraisals, and career path opportunities, we allow and motivate our employees to gain competence, develop, and like what they do.\r\n\r\nWhile our services are designed to maximize revenue, our delivery operations are built to drive efficiency. Through our global network we can provide service in any country where our clients have customers, accessing the most appropriate skills and deploying the best communication channels in the most cost-effective locations.\r\n\r\nCultures and Values\r\n\r\nTranscom''s 5 Key Values:\r\n\r\n1. Honesty - Is critical in everything we do. Being an open book. It is from Honesty that trust and Loyalty are built.\r\n2. Fun - Means enjoying the work we do, enjoying the team spirit, enjoying the daily contact with our clients. When there is no fun, there cannot be lasting lasting commitment.\r\n3. Passion - Implies enthusiasm, commitment, energy and pride in our work. Passion dictates what we "put in" to life and normally what people "put in" will balance what they get out.\r\n4. Innovation - Means creativity, finding solutions where others see barriers. An open mind creates opportunities, overcomes challenges...\r\n5. Excellence - Means standing out, striving for perfection in everything we do. It implies examining, improving, reinventing.\r\n \r\nBenefits:\r\nTranscom is a global employer in an industry that depends upon strong, resourceful, talented people. \r\nA career with Transcom offers:\r\nCompetitive salaries and benefits \r\nIncentives linked to personal performance and the results you deliver for our clients \r\nRegular performance reviews linked to personal development plans \r\nConsistent training and objective coaching \r\nFriendly and fun working environments \r\n \r\nOther Information:\r\nTranscom as a global employer values Corporate Responsibility.  At Transcom corporate responsibility (CR) means:\r\nTaking a sustainable, ethical approach in our mission to provide high quality solutions to our clients and their customers. \r\nCreating honest, flexible, safe and comfortable working environments where our people\r\ncan develop their careers and enjoy their working lives. \r\nEncouraging our people’s energy and enthusiasm to take part in community-based and international charitable activities. \r\nWe abide by a strict Code of Business Conduct, which outlines the ethical practices adopted across our company and the standards to which our people are expected to aspire.  A Supplier Code of Business Conduct, which details the standards to which our suppliers and partners are expected to adhere.  An Environmental Policy, which describes our commitment to a responsible approach to reduce the environmental impact of our business and to encourage our people to adopt environmentally friendly working practices.  Across the globe we have been involved in various humanitarian causes that we do not publicize.   In the Philippines, we do our community based services through our program Transcom cares.', '006-944-742', 'CS200800187', 0, 0, 0, 'PH', '7022447', '7022433', 'www.transcom.com', '259-20120223-Transcom_Logo_Web.gif', '2011-05-23 00:00:00', '2012-02-23 00:00:00', 1, 0),
(660, 'MAYFAIR INTERNATIONAL TECHNOLOGIES, INC.', 'Mayfair International Technologies Inc was incorporated in the Philippines on 10 April 2008, basically to provide management service and IT support to Winner Mayfair Limited, a British Virgin Island (BVI) company and a licensee of First Cagayan Leisure and Resort Corp. (FCLRC)\r\n                                                                             \r\n    Mayfair International Technologies Inc. is a Cagayan Special Economic Zone and Freeport (CSEZFP) Registered Enterprise with Certificate No. CF-091 dated 26 May 2008. As a CEZA registered enterprise, it is a beneficiary of fiscal incentives established under CEZA Implementing Rules and Regulations such as exemption from local and national taxes, including customs taxes and duties and VAT. The company is located at The RCBC Plaza, Ayala Avenue, Makati', 'bogus', 'bogus', 0, 0, 0, 'PH', '887-2052', '', '', NULL, '2011-05-23 00:00:00', '2011-06-01 00:00:00', 1, 0),
