(673, 'U.S. Autoparts Network Philippines Corp.', 'U.S. Auto Parts Network (U.S. Auto Parts) sells aftermarket auto parts, including body parts, engine parts, performance parts and accessories to individual consumers through its network of Websites and online marketplaces in the U.S. Its websites provide customers with a selection of approximately 550,000 SKU''s with detailed product descriptions and photographs. It has developed a product database, which maps its 550,000 SKUs to over 4.3 million product applications based on vehicle makes, models and years.\r\n\r\nU.S. Auto Parts Network, Inc. has been ranked 81st in Internet Retailer magazine''s annual Top 500 list of the largest online retailers (2007). This marks a significant increase from the previous year''s list in which U.S. Auto Parts was ranked 166th. The Company also ranked fifth in the "Specialty/Non-Apparel" category, jumping from 16th last year.\r\n\r\nThe industry-leading magazine publishes the definitive ranking and analysis of America''s 500 largest e-retailers based on annual 2006 Internet sales, researched by Internet Retailer and confirmed by retailers. U.S. Auto Parts is joined on the list by other industry leaders including Amazon.com, Blue Nile, VistaPrint, and QVC.', 'bogus', 'bogus', 0, 0, 0, 'PH', '0000000000', '', 'http://www.usautoparts.com.ph', '273-20110527-a.JPG', '2011-05-26 00:00:00', '2011-05-27 00:00:00', 1, 0),
