(681, 'www.Remotestaff.com.au', 'At Remote Staff, we have developed a unique business model that is specifically designed to assist you in hiring the right staff to work remotely as well as providing tight HR systems and technologies allowing you more control over someone working half way around the world, compared to someone working beside you in an office.\r\n\r\nFounded in 2007, Remote Staff is an Australian owned Company with representatives across the globe from the USA, Australia, Canada and the UK. Remote Staff have confronted just about all the challenges associated in contracting staff from abroad and as a result have helped 100''s of International clients establish lasting and successful working relationships, in some cases longer than 3 years, with staff located overseas. Remote Staff is well on the way to achieving it''s future objectives of 1,000 staff by the end of 2012.', 'bogus', 'bogus', 0, 0, 0, 'PH', '0000000000', '', '', '281-20110527-remote.JPG', '2011-05-26 00:00:00', '2011-05-27 00:00:00', 1, 0),
(682, 'ProView Global Administration, Inc.', NULL, 'bogus', 'bogus', 0, 0, 0, 'PH', 'N/A', '', '', NULL, '2011-05-26 00:00:00', NULL, 1, 0),
(683, 'Quinn Data Facilities', 'Quinn Data Facilities, Inc (QDF) is an innovative and fast growing call center in the Philippines today. Located in the Central Business District (CBD) of Makati, the company provides unprecedented services and opportunities to the call center industry focusing on data management and outbound telephone fundraising. Its main goal is to provide best quality data and dynamic Outbound Telephone services to its premier charity clients in the UK and in Australia.', 'bogus', 'bogus', 0, 0, 0, 'PH', '7531930 or 7534298', '+63 2 7534241', 'http://qdf-phils.com/', '283-20110527-qdf.JPG', '2011-05-26 00:00:00', '2011-05-27 00:00:00', 1, 0),
(684, 'Rainmaker Asia', 'Rainmaker Asia is an offshore call center in the Philippines. We specialize in providing customized business solutions to dynamic companies around the world. We offer customer service, marketing, administrative and technical support to a variety of industries.', 'bogus', 'bogus', 0, 0, 0, 'PH', '878 1526', '878 1533', 'www.rainmakersystems.com', '284-20110527-untitled.JPG', '2011-05-26 00:00:00', '2011-05-27 00:00:00', 1, 0),
(685, 'REED ELSEVIER SHARED SERVICES (PHILIPPINES) INC.', 'LexisNexis® is a division of Reed Elsevier, a world leading provider of professional information, and delivers content-enabled solutions to professionals in the legal, corporate and government markets.\r\n\r\nWe originally pioneered online information with our Lexis® and Nexis® services and now serve customers in more than 100 countries and have more than 15,000 employees worldwide. \r\n\r\nLexisNexis has been working with supplier partners in the Philippines for more than 10 years.  We are now building a captive offshore delivery center located at the UP-AyalaLand Technohub in Quezon City as well as continuing to build upon our supplier partnerships.\r\n\r\nYou''re looking for a challenging position in the Philippines with growth potential in one of the world’s leading information solutions companies.  We''re looking for smart, driven people who will help us deliver superior solutions and a best-in-class customer experience.', 'bogus', 'bogus', 0, 0, 0, 'PH', 'N/A', '', 'http://www.lexisnexis.com.ph', '285-20110527-lexis.JPG', '2011-05-26 00:00:00', '2011-05-27 00:00:00', 1, 0),
(686, 'Rinascimiento Management and Development Corporation (RMDC)', 'Rinascimiento Management and Development Corporation (RMDC) is a service oriented firm that provides exclusive topnotch front office solution to its highly specialized parent company. Strategically located at the prime district of Makati, RMDC naturally operates on a mid shift schedule, five days a week. The company is run by young, flexible, talented and dedicated individuals who have a strong vision to succeed.\r\n \r\nWe require the expertise of professionals for our team. If you see yourself working with highly-energetic, top caliber Lead Generation and Telemarketing specialists, then, we would like to hear from you.\r\n \r\nWe offer above average compensation package to successful applicants.', 'bogus', 'bogus', 0, 0, 0, 'PH', '8468709', '', '', '286-20110527-21cfr7k.jpg', '2011-05-26 00:00:00', '2011-05-27 00:00:00', 1, 0),
