(703, '24/7 Customer Philippines Inc.', '24/7 Customer is a global company that provides exciting career opportunities for its employees. 24/7 Customer provides an environment that creates, encourages and rewards outperformers. 24/7ites are proud of the fact that they are the best in terms of performance in the contact center industry worldwide. 24/7 Customer’s people practices have been rated amongst the best in the industry. In 2008, 24/7 Customer was ranked amongst the top 10 best companies in Human Capital Management by the Global Services magazine in their annual survey of outsourcing service providers.\r\n\r\nA unique work culture that encourages creativity, teamwork and openness, enables learning and empowers people to take decisions supported by a strong focus on employee growth makes 24/7 Customer a truly great place to work.', '243882270000', 'CS200602456', 0, 0, 0, 'PH', '7924777', '', 'www.247customer.com', '316-20110721-247_head031111-C.gif', '2011-07-04 00:00:00', '2011-07-21 00:00:00', 1, 0),
