(751, 'Magellan Solutions Outsourcing', 'Magellan Solutions Call Center\r\n\r\n Vision\r\n\r\nMagellan’s vision is to become the recognized Philippine provider of offshore call center solutions for small-to-medium sized enterprises, entrepreneurs and professionals.\r\n\r\nFor our Clients:\r\n\r\n    * To provide the same complete quality of service offered by large multi-national call centers to the SMEs, entrepreneurs and professionals in all the major and \r\n      emerging markets.\r\n    * To provide a close “partnership” like arrangement where the goal is mutual development.\r\n\r\nFor our Employees:\r\n\r\n    * To provide a family atmosphere where its employees strive for the good of the company, and are rewarded based on performance, team work and dedication.\r\n    * To provide an environment where employees want to grow with because it provides a supportive group that is dedicated for the well-being of everyone.\r\n\r\nMission\r\n\r\nMagellan’s mission is to provide superior value to our clients by offering contact center and business process outsourcing services with five important value levers:\r\n\r\n    * High quality customer service and back office associates;\r\n    * Best practice management processes;\r\n    * True cost saving proposition;\r\n    * Process transparency; and\r\n    * Continuous improvement methodologies', '012345678901234', '012345678901234', 0, 0, 0, 'PH', '6214625', '6214625', 'www.magellan-solutions.com', '364-20110712-4428_magellan_solutions_logo.jpg', '2011-07-11 00:00:00', '2011-07-12 00:00:00', 1, 0),
